import React from "react";
import "../styles/index.css";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlayCircle } from "@fortawesome/free-solid-svg-icons";

const NavStyle = {
  top: "auto",
  bottom: 0,
  height: "6rem",
  boxShadow: "0 20px 10px rgba(0,0,0,1), 2px 6px 6px rgba(0,0,0,1)"
};

const ToolbarStyle = {
  top: "50%",
  transform: "translateY(-50%)"
};

const PlayButtonStyle = {
  color: "#692d55",
  position: "relative",
  paddingLeft: "45rem"
};

class PlayButton extends React.Component {
  render() {
    return <FontAwesomeIcon className=" inl-blk fa-4x" icon={faPlayCircle} />;
  }
}

export default class BottomNav extends React.Component {
  render() {
    return (
      <AppBar style={NavStyle} position="fixed" color="white">
        <Toolbar style={ToolbarStyle} />
        <PlayButton style={PlayButtonStyle} />
      </AppBar>
    );
  }
}
